import React, { Component } from 'react';
import './Calculator.css';

class CalcButton extends Component {

  render() {
    return (
      <div onClick={() => this.props.clickHandler(this.props.text)}>
        {this.props.text}
      </div>
    )
  }
}

class Calculator extends Component {
  constructor(props){
    super(props);
    this.state = {
      result: ""
    };
  }

  buttonHandler(val) {
    console.log("buttonHandler", val);
  }

  render() {
    return (
      <div>
        <div>
          {this.state.result}
        </div>
        <table>
          <tr>
            <td colspan="2"><CalcButton text={"clear"}/></td>
            <td><CalcButton text={'*'} clickHandler={(v) => this.buttonHandler(v)}/></td>
            <td><CalcButton text={'/'}/></td>
          </tr>
          <tr>
            <td><CalcButton text={1}/></td>
            <td><CalcButton text={2}/></td>
            <td><CalcButton text={3}/></td>
            <td><CalcButton text={'+'}/></td>
          </tr>
          <tr>
            <td><CalcButton text={4}/></td>
            <td><CalcButton text={5}/></td>
            <td><CalcButton text={6}/></td>
            <td><CalcButton text={'-'}/></td>
          </tr>
          <tr>
            <td><CalcButton text={7}/></td>
            <td><CalcButton text={8}/></td>
            <td><CalcButton text={9}/></td>
            <td><CalcButton text={'='}/></td>
          </tr>
        </table>
      </div>
    );
  }
}

export default Calculator;
